import torch
import torch.nn as nn
import torch.optim as optim
from torchvision import datasets, transforms
from torch.utils.data import DataLoader
from sklearn.metrics import accuracy_score

batch_size = 64

transform = transforms.Compose([
    transforms.Resize((32, 32)),
    transforms.ToTensor(),
    transforms.Normalize((0.5,), (0.5,))  # Normalize to [-1, 1]
])

train_data = datasets.MNIST(root='./data', train=True, download=True, transform=transform)
test_data = datasets.MNIST(root='./data', train=False, download=True, transform=transform)

train_loader = DataLoader(train_data, batch_size=batch_size, shuffle=True)
test_loader = DataLoader(test_data, batch_size=batch_size, shuffle=False)

class LeNet5(nn.Module):
    def __init__(self):
        super(LeNet5, self).__init__()
        self.conv1 = nn.Conv2d(1, 6, kernel_size=5, stride=1, padding=2)
        self.pool = nn.AvgPool2d(2, 2)
        self.conv2 = nn.Conv2d(6, 16, kernel_size=5)
        self.fc1 = nn.Linear(16 * 6 * 6, 120)  # Adjusted to 16 * 6 * 6 = 576
        self.fc2 = nn.Linear(120, 84)
        self.fc3 = nn.Linear(84, 10)  # 10 classes for MNIST

    def forward(self, x):
        x = torch.relu(self.conv1(x))  # Conv Layer 1 + ReLU
        x = self.pool(x)               # Pooling Layer 1
        x = torch.relu(self.conv2(x))  # Conv Layer 2 + ReLU
        x = self.pool(x)               # Pooling Layer 2
        x = x.view(-1, 16 * 6 * 6)     # Flatten with adjusted shape
        x = torch.relu(self.fc1(x))    # Fully Connected Layer 1 + ReLU
        x = torch.relu(self.fc2(x))    # Fully Connected Layer 2 + ReLU
        x = self.fc3(x)                # Output Layer
        return x

device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
model = LeNet5().to(device)
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=0.001)
epochs = 10

from tqdm import tqdm

for epoch in range(epochs):
    model.train()
    train_loss = 0.0
    train_loader_with_progress = tqdm(train_loader, desc=f"Epoch {epoch+1}/{epochs} - Training", leave=False)
    for images, labels in train_loader_with_progress:
        images, labels = images.to(device), labels.to(device)
        optimizer.zero_grad()
        outputs = model(images)
        loss = criterion(outputs, labels)
        loss.backward()
        optimizer.step()
        train_loss += loss.item()

        train_loader_with_progress.set_postfix(train_loss=loss.item())

    model.eval()
    test_loss = 0.0
    test_preds, test_labels = [], []
    test_loader_with_progress = tqdm(test_loader, desc="Evaluating", leave=False)
    with torch.no_grad():
        for images, labels in test_loader_with_progress:
            images, labels = images.to(device), labels.to(device)
            outputs = model(images)
            loss = criterion(outputs, labels)
            test_loss += loss.item()
            _, preds = torch.max(outputs, 1)
            test_preds.extend(preds.cpu().numpy())
            test_labels.extend(labels.cpu().numpy())

            # Update progress bar with current loss
            test_loader_with_progress.set_postfix(test_loss=loss.item())

    # Calculate average losses and test accuracy
    train_loss /= len(train_loader)
    test_loss /= len(test_loader)
    test_acc = accuracy_score(test_labels, test_preds)


    print(f"Epoch {epoch+1}/{epochs}, Train Loss: {train_loss:.4f}, Test Loss: {test_loss:.4f}, Test Accuracy: {test_acc:.4f}")

"""## **AlexNet Architecture**

AlexNet, introduced by Alex Krizhevsky et al. in 2012, marked a breakthrough in deep learning and computer vision, winning the ImageNet competition by a large margin. AlexNet introduced key innovations, including ReLU activations, dropout, and extensive use of GPUs for training, setting the standard for modern CNN architectures.

---
![image.png](data:image/png;base64,)
### **Architecture Overview**

1. **Input Layer**
   - **Input Size**: **224x224x3** (RGB image)
   - **Purpose**: Resizes all images to a fixed size of 224x224 pixels for standardization and consistent processing.

2. **C1 – First Convolutional Layer**
   - **Operation**: Applies **96 filters** of size **11x11** with a **stride of 4**.
   - **Output**: **55x55x96**
   - **Explanation**:
     - Large filter size captures broad spatial patterns.
     - **ReLU activation** follows the convolution to introduce non-linearity.
     - **Local Response Normalization (LRN)** helps normalize the activations, reducing the likelihood of neuron saturation.
  
3. **S2 – First Max Pooling Layer**
   - **Operation**: Applies **max pooling** with a **3x3 filter** and **stride of 2**.
   - **Output**: **27x27x96**
   - **Explanation**:
     - Reduces spatial dimensions, focusing on the most prominent features within each region.
     - Pooling provides translation invariance, making feature detection more robust.

4. **C3 – Second Convolutional Layer**
   - **Operation**: Applies **256 filters** of size **5x5** with a **stride of 1** and **padding of 2**.
   - **Output**: **27x27x256**
   - **Explanation**:
     - Increases depth, allowing the model to learn more complex patterns and textures.
     - Uses **ReLU activation** and **LRN** for normalization.

5. **S4 – Second Max Pooling Layer**
   - **Operation**: Applies **3x3 max pooling** with **stride of 2**.
   - **Output**: **13x13x256**
   - **Explanation**:
     - Down-samples the feature maps to reduce spatial dimensions while retaining critical information.
     - Continues to build translation invariance.

6. **C5 – Third Convolutional Layer**
   - **Operation**: Applies **384 filters** of size **3x3** with **stride of 1** and **padding of 1**.
   - **Output**: **13x13x384**
   - **Explanation**:
     - Captures more detailed patterns, combining outputs from previous layers.
     - **ReLU activation** applied for non-linearity.

7. **C6 – Fourth Convolutional Layer**
   - **Operation**: Applies **384 filters** of size **3x3** with **stride of 1** and **padding of 1**.
   - **Output**: **13x13x384**
   - **Explanation**:
     - Another layer of **3x3 convolutions** to learn even more complex patterns.
     - **ReLU activation** applied.

8. **C7 – Fifth Convolutional Layer**
   - **Operation**: Applies **256 filters** of size **3x3** with **stride of 1** and **padding of 1**.
   - **Output**: **13x13x256**
   - **Explanation**:
     - Final convolutional layer before fully connected layers.
     - **ReLU activation** applied.
  
9. **S8 – Third Max Pooling Layer**
   - **Operation**: Applies **3x3 max pooling** with **stride of 2**.
   - **Output**: **6x6x256**
   - **Explanation**:
     - Further down-samples the feature maps, resulting in a compact and informative representation.

10. **Flattening Layer**
    - **Operation**: Flattens the **6x6x256** feature maps to a **1D vector of size 9216**.
    - **Purpose**: Prepares the data for fully connected layers.

11. **F9 – First Fully Connected Layer**
    - **Operation**: 4096 neurons fully connected to the 9216 input features.
    - **Output**: **4096-dimensional vector**
    - **Explanation**:
      - Uses **ReLU activation** and **dropout** with a probability of **0.5** to prevent overfitting.

12. **F10 – Second Fully Connected Layer**
    - **Operation**: 4096 neurons fully connected to the previous 4096 neurons.
    - **Output**: **4096-dimensional vector**
    - **Explanation**:
      - Another fully connected layer with **ReLU activation** and **dropout** for added regularization.

13. **Output Layer (Softmax)**
    - **Operation**: Fully connected layer with **1000 neurons** (for 1000 classes in ImageNet).
    - **Output**: **1000-dimensional vector** representing class probabilities.
    - **Explanation**:
      - Uses **softmax activation** to output probabilities for each class, suitable for multi-class classification.

---

### **Summary of Feature Map Sizes Across Layers**

| Layer  | Type                | Input Size     | Filter Size | Stride | Feature Maps | Output Size       |
|--------|----------------------|----------------|-------------|--------|--------------|-------------------|
| Input  | Image               | 224x224x3      | -           | -      | 3            | 224x224x3         |
| C1     | Convolutional       | 224x224x3      | 11x11       | 4      | 96           | 55x55x96          |
| S2     | Max Pooling         | 55x55x96       | 3x3         | 2      | 96           | 27x27x96          |
| C3     | Convolutional       | 27x27x96       | 5x5         | 1      | 256          | 27x27x256         |
| S4     | Max Pooling         | 27x27x256      | 3x3         | 2      | 256          | 13x13x256         |
| C5     | Convolutional       | 13x13x256      | 3x3         | 1      | 384          | 13x13x384         |
| C6     | Convolutional       | 13x13x384      | 3x3         | 1      | 384          | 13x13x384         |
| C7     | Convolutional       | 13x13x384      | 3x3         | 1      | 256          | 13x13x256         |
| S8     | Max Pooling         | 13x13x256      | 3x3         | 2      | 256          | 6x6x256           |
| F9     | Fully Connected     | 9216           | -           | -      | 4096         | 4096              |
| F10    | Fully Connected     | 4096           | -           | -      | 4096         | 4096              |
| Output | Fully Connected     | 4096           | -           | -      | 1000         | 1000              |

---

### **Key Takeaways**

- **Innovations in AlexNet**:
  - **ReLU Activation**: Faster convergence and avoids gradient vanishing issues.
  - **Dropout**: Reduces overfitting by randomly disabling neurons during training.
  - **Local Response Normalization (LRN)**: Used in early layers to normalize activations and improve generalization.
  - **Parallel GPU Training**: Enabled AlexNet to scale and train faster.

- **Pooling Layers**: Downsample spatial dimensions to reduce the computational load while maintaining the most significant features.

- **Fully Connected Layers**: Help combine features learned by previous layers for high-level representation and classification.

AlexNet's architecture set the stage for deep networks to tackle complex image classification tasks and paved the way for CNN advances in computer vision.

---

"""

import torch
import torch.nn as nn
import torch.optim as optim
from torchvision import datasets, transforms
from torch.utils.data import DataLoader
import tqdm
from sklearn.metrics import accuracy_score

batch_size = 8
epochs=10

device = torch.device("cuda" if torch.cuda.is_available() else "cpu")

transforms = transforms.Compose([
    transforms.Resize((227,227)),
    transforms.ToTensor(),
    transforms.Normalize((0.4914, 0.4822, 0.4465), (0.2023, 0.1994, 0.2010))
])

train_data = datasets.CIFAR10(root='./c_data', train=True, download=True, transform=transforms)
test_data = datasets.CIFAR10(root='./c_data', train=True, download=True, transform=transforms)

train_loader = DataLoader(train_data, batch_size=batch_size, shuffle=True)
test_loader = DataLoader(test_data, batch_size=batch_size, shuffle=False)

class AlexNet(nn.Module):
  def __init__(self, num_classes=10):
    super(AlexNet, self).__init__()
    self.features = nn.Sequential(
        nn.Conv2d(3, 32, kernel_size=3, stride=1, padding=1),
        nn.ReLU(inplace=True),
        nn.MaxPool2d(kernel_size=2, stride=2),

        nn.Conv2d(32, 64, kernel_size=3, stride=1, padding=1),
        nn.ReLU(inplace=True),
        nn.MaxPool2d(kernel_size=2, stride=2),

        nn.Conv2d(64, 128, kernel_size=3, stride=1, padding=1),
        nn.ReLU(inplace=True),

        nn.Conv2d(128, 256, kernel_size=3, stride=1, padding=1),
        nn.ReLU(inplace=True),

        nn.Conv2d(256, 256, kernel_size=3, stride=1, padding=1), #feature size is reduces to 256*4*4 = 4096
        nn.ReLU(inplace=True),
        nn.MaxPool2d(kernel_size=2, stride=2)
    )

    self.classifier = nn.Sequential(
        nn.Dropout(0.5),
        nn.Linear(256*28*28, 4096),
        nn.ReLU(inplace=True),

        nn.Dropout(0.5),
        nn.Linear(4096, 4096),
        nn.ReLU(inplace=True),

        nn.Linear(4096, num_classes)
    )

  def forward(self, x):
    x = self.features(x)
    print(f"Features output shape: {x.shape}")  # Add this
    x = x.view(x.size(0), -1)
    x = self.classifier(x)
    return x

model = AlexNet(num_classes=10).to(device)
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=0.001)

from tqdm import tqdm

# Training and validation loop
epochs = 10
for epoch in range(epochs):
    print(f"Epoch {epoch+1}/{epochs}")

    # Training phase
    model.train()
    train_loss = 0.0
    train_loader_tqdm = tqdm(train_loader, desc="Training", leave=False)
    for images, labels in train_loader_tqdm:
        images, labels = images.to(device), labels.to(device)

        optimizer.zero_grad()
        outputs = model(images)
        loss = criterion(outputs, labels)
        loss.backward()
        optimizer.step()
        train_loss += loss.item()
        train_loader_tqdm.set_postfix(loss=loss.item())

    # Validation phase
    model.eval()
    test_loss = 0.0
    test_preds, test_labels = [], []
    test_loader_tqdm = tqdm(test_loader, desc="Validating", leave=False)
    with torch.no_grad():
        for images, labels in test_loader_tqdm:
            images, labels = images.to(device), labels.to(device)
            outputs = model(images)
            loss = criterion(outputs, labels)
            test_loss += loss.item()
            _, preds = torch.max(outputs, 1)
            test_preds.extend(preds.cpu().numpy())
            test_labels.extend(labels.cpu().numpy())
            test_loader_tqdm.set_postfix(loss=loss.item())

    # Calculate average losses and accuracy
    train_loss /= len(train_loader)
    test_loss /= len(test_loader)
    test_acc = accuracy_score(test_labels, test_preds)

    print(f"Epoch {epoch+1}/{epochs}, Train Loss: {train_loss:.4f}, Test Loss: {test_loss:.4f}, Test Accuracy: {test_acc:.4f}")

"""# **VGG16 Architecture Notes**

### **Overview**
- **VGG16** is a convolutional neural network introduced by the Visual Geometry Group (VGG) in 2014. It achieved great success in the ImageNet competition due to its simplicity and effectiveness.
- It uses **deep convolutional layers** with small filters (3x3) and relies on **depth** (16 weight layers) to improve feature extraction.

![image.png](data:image/png;base64,)
---

### **Key Features**
- **Depth**: VGG16 has **16 layers** with learnable weights:
  - **13 convolutional layers**
  - **3 fully connected layers**
- **Filter Size**: All convolutional layers use **3x3 filters**.
- **Padding**: All convolutional layers use **same padding**, so spatial dimensions are preserved after convolution.
- **Pooling**: **Max pooling** with a **2x2 filter and stride 2** is used after specific layers to reduce spatial dimensions.
- **Activation**: ReLU (Rectified Linear Unit) is used as the activation function for all layers.
- **Classification Head**: Ends with 3 fully connected layers followed by a **Softmax** layer for classification.

---

### **Detailed Architecture**
| Layer Type                | Input Size       | Output Size       | Operations |
|---------------------------|------------------|-------------------|------------|
| **Input**                 | 224x224x3       | 224x224x3         | RGB Image  |
| **Conv1_1**               | 224x224x3       | 224x224x64        | 3x3 filters (64 filters) |
| **Conv1_2**               | 224x224x64      | 224x224x64        | 3x3 filters (64 filters) |
| **Max Pooling**           | 224x224x64      | 112x112x64        | 2x2, stride 2 |
| **Conv2_1**               | 112x112x64      | 112x112x128       | 3x3 filters (128 filters) |
| **Conv2_2**               | 112x112x128     | 112x112x128       | 3x3 filters (128 filters) |
| **Max Pooling**           | 112x112x128     | 56x56x128         | 2x2, stride 2 |
| **Conv3_1**               | 56x56x128       | 56x56x256         | 3x3 filters (256 filters) |
| **Conv3_2**               | 56x56x256       | 56x56x256         | 3x3 filters (256 filters) |
| **Conv3_3**               | 56x56x256       | 56x56x256         | 3x3 filters (256 filters) |
| **Max Pooling**           | 56x56x256       | 28x28x256         | 2x2, stride 2 |
| **Conv4_1**               | 28x28x256       | 28x28x512         | 3x3 filters (512 filters) |
| **Conv4_2**               | 28x28x512       | 28x28x512         | 3x3 filters (512 filters) |
| **Conv4_3**               | 28x28x512       | 28x28x512         | 3x3 filters (512 filters) |
| **Max Pooling**           | 28x28x512       | 14x14x512         | 2x2, stride 2 |
| **Conv5_1**               | 14x14x512       | 14x14x512         | 3x3 filters (512 filters) |
| **Conv5_2**               | 14x14x512       | 14x14x512         | 3x3 filters (512 filters) |
| **Conv5_3**               | 14x14x512       | 14x14x512         | 3x3 filters (512 filters) |
| **Max Pooling**           | 14x14x512       | 7x7x512           | 2x2, stride 2 |
| **Flatten**               | 7x7x512         | 25088             | Converts to 1D |
| **FC1**                   | 25088           | 4096              | Fully connected layer |
| **FC2**                   | 4096            | 4096              | Fully connected layer |
| **FC3**                   | 4096            | 1000              | Fully connected layer |
| **Softmax**               | 1000            | 1000              | Outputs class probabilities |

---

### **Feature Size Changes**
- **Input Size**: 224x224x3
- After each **convolutional block**, the feature size remains the same because of **same padding**.
- After each **max pooling** layer, the spatial size is halved (e.g., 224x224 → 112x112 → 56x56 → 28x28 → 14x14 → 7x7).
- Depth increases progressively as the number of filters increases (64 → 128 → 256 → 512).

---

### **Key Advantages**
- **Simplicity**: Uses small 3x3 filters throughout, making it easier to stack deeper layers.
- **High Accuracy**: Achieved high performance on the ImageNet dataset.
- **Transfer Learning**: Pretrained VGG16 models are widely used for transfer learning in many vision tasks.

---

### **Drawbacks**
- **Computational Cost**: Requires significant memory and computational resources due to the large number of parameters (~138M).
- **Redundancy**: Uses fully connected layers at the end, which increases the parameter count unnecessarily.

---


"""

import torch
import torch.nn as nn
import torch.optim as optim
from torchvision import datasets, transforms, models
from torch.utils.data import DataLoader
from tqdm import tqdm
from sklearn.metrics import accuracy_score

BATCH_SIZE = 128
EPOCHS = 16

device = torch.device("cuda" if torch.cuda.is_available() else "cpu")

transform_train = transforms.Compose([
    transforms.Resize((224, 224)),
    transforms.RandomCrop(32, padding=4),
    transforms.RandomHorizontalFlip(),
    transforms.ToTensor(),
    transforms.Normalize(mean=[0.5, 0.5, 0.5], std=[0.5, 0.5, 0.5])
])

transforms_test = transforms.Compose(([
    transforms.Resize((224,224)),
    transforms.ToTensor(),
    transforms.Normalize(mean=[0.5, 0.5, 0.5], std=[0.5, 0.5, 0.5])
]))

"""## **importing the CIFAR10 data just for practice :)**"""

train_data = datasets.CIFAR10(root='./data', train=True, download=True, transform=transform_train)
test_data = datasets.CIFAR10(root='./data', train=False, download=True, transform=transforms_test)

train_loader = DataLoader(train_data, batch_size=BATCH_SIZE, shuffle=True)
test_loader = DataLoader(test_data, batch_size=BATCH_SIZE, shuffle=False)

"""## **Using pretrained weights of VGG16**"""

model = models.vgg16(pretrained=True)

# Modifying the classifier for CIFAR-10
model.classifier[6] = nn.Linear(4096, 10)
model = model.to(device)

# Loss and Optimizer
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=0.001)

for epoch in range(EPOCHS):
    model.train()
    train_loss = 0.0

    print(f"Epoch {epoch+1}/{EPOCHS}")
    train_loader_tqdm = tqdm(train_loader, desc="Training")  # Add progress bar to training

    for images, labels in train_loader_tqdm:
        images, labels = images.to(device), labels.to(device)

        optimizer.zero_grad()
        outputs = model(images)
        loss = criterion(outputs, labels)
        loss.backward()
        optimizer.step()

        train_loss += loss.item()
        train_loader_tqdm.set_postfix(loss=loss.item())  # Update tqdm bar with current loss

    # Validation Loop
    model.eval()
    test_loss = 0.0
    correct = 0
    total = 0

    test_loader_tqdm = tqdm(test_loader, desc="Validating")  # Add progress bar to validation

    with torch.no_grad():
        for images, labels in test_loader_tqdm:
            images, labels = images.to(device), labels.to(device)
            outputs = model(images)
            loss = criterion(outputs, labels)

            test_loss += loss.item()
            _, preds = torch.max(outputs, 1)
            correct += (preds == labels).sum().item()
            total += labels.size(0)

    train_loss /= len(train_loader)
    test_loss /= len(test_loader)
    test_acc = correct / total

    print(f"Train Loss: {train_loss:.4f}, Test Loss: {test_loss:.4f}, Test Accuracy: {test_acc:.4f}\n")

"""### VGG16 performs poor on CIFAR-10 as this requires more advanced model architecture like RESNETS discussed further.

## **Architecture of VGG-16 from scratch**
"""

class VGG16(nn.Module):
    def __init__(self, num_classes=10):  # For CIFAR-10
        super(VGG16, self).__init__()

        # Convolutional layers
        self.features = nn.Sequential(
            # Block 1
            nn.Conv2d(3, 64, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(64, 64, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.MaxPool2d(kernel_size=2, stride=2),

            # Block 2
            nn.Conv2d(64, 128, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(128, 128, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.MaxPool2d(kernel_size=2, stride=2),

            # Block 3
            nn.Conv2d(128, 256, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(256, 256, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(256, 256, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.MaxPool2d(kernel_size=2, stride=2),

            # Block 4
            nn.Conv2d(256, 512, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(512, 512, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(512, 512, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.MaxPool2d(kernel_size=2, stride=2),

            # Block 5
            nn.Conv2d(512, 512, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(512, 512, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.Conv2d(512, 512, kernel_size=3, padding=1),
            nn.ReLU(inplace=True),
            nn.MaxPool2d(kernel_size=2, stride=2),
        )

        # Fully connected layers
        self.classifier = nn.Sequential(
            nn.Linear(512 * 1 * 1, 4096),  # Adjusted for CIFAR-10 size 32x32 -> feature map 1x1
            nn.ReLU(inplace=True),
            nn.Dropout(0.5),
            nn.Linear(4096, 4096),
            nn.ReLU(inplace=True),
            nn.Dropout(0.5),
            nn.Linear(4096, num_classes),
        )

    def forward(self, x):
        x = self.features(x)
        x = x.view(x.size(0), -1)
        x = self.classifier(x)
        return x

